using PT.Core.Sql.DataProvider;
using PT.Core.Model.Interface;
using PT.Core.Model.Interface.Sites;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Web;

namespace PartsTown.CustomData.Magic360
{
    /// <summary>
    /// Repository for accessing Magic360 image data from Ice schema in ERP database
    /// Following PT.Core repository patterns from v4.18.0.3543
    /// </summary>
    public class Magic360ImageRepository : IMagic360ImageRepository
    {
        private readonly ISiteDataAccessConnectionFactory ConnectionFactory;
        private readonly ISite Site;
        private readonly IErrorLogger ErrorLogger;

        public Magic360ImageRepository(
            ISiteDataAccessConnectionFactory factory,
            ISite site,
            IErrorLogger errorLogger = null)  // Optional for backward compatibility
        {
            ConnectionFactory = factory ?? throw new ArgumentNullException(nameof(factory));
            Site = site ?? throw new ArgumentNullException(nameof(site));
            ErrorLogger = errorLogger; // Can be null if not available
        }


        public IEnumerable<XFileRef> FindFileRef(IEnumerable<int> fileRefNum)
        {
            if (fileRefNum == null || !fileRefNum.Any())
                return new List<XFileRef>();

            using(var dataAccess = ConnectionFactory.GetErp().GetDataAccess())
            {
                // Build parameters using SqlParameterList
                var parameters = new SqlParameterList();
                parameters.AddRange(fileRefNum);

                // Build SQL with proper parameter placeholders
                // Note: Company parameter is added AFTER the IN clause parameters
                string sql = $@"SELECT Company, XFileRefNum, XFileName, XFileDesc
                               FROM [Ice].[XFileRef]
                               WHERE Company = @p{parameters.Count}
                               AND XFileRefNum IN ({parameters.SqlString})";

                // Add company parameter after the IN clause parameters
                parameters.Add(Site.CompanyCode);

                // Use IDataAccess Query method
                return dataAccess.Query<XFileRef>(sql, parameters).ToList();
            }
        }

        public IEnumerable<XFileAttch> FindRefByStockCode(IEnumerable<string> stockCode)
        {
            if (stockCode == null || !stockCode.Any())
                return new List<XFileAttch>();

            using (var dataAccess = ConnectionFactory.GetErp().GetDataAccess())
            {
                // Build parameters using SqlParameterList
                var parameters = new SqlParameterList();
                parameters.AddRange(stockCode);

                // Based on research: XFileRef contains Key1 (part number),
                // XFileAttch contains the actual file data
                // We need to JOIN these tables to get complete data
                string sql = $@"
                    SELECT
                        xa.Company,
                        xa.XFileRefNum,
                        xa.DrawingSeq,
                        xa.XFileName,
                        xa.XFilePath,
                        xa.Data,
                        xa.DocTypeID,
                        xf.RelatedToFile,
                        xf.Key1
                    FROM [Ice].[XFileAttch] xa
                    INNER JOIN [Ice].[XFileRef] xf
                        ON xa.Company = xf.Company
                        AND xa.XFileRefNum = xf.XFileRefNum
                    WHERE xf.Company = @p{parameters.Count}
                        AND xf.RelatedToFile = 'Part'
                        AND xf.Key1 IN ({parameters.SqlString})";

                // Add company parameter after the IN clause parameters
                parameters.Add(Site.CompanyCode);

                // Use IDataAccess Query method
                return dataAccess.Query<XFileAttch>(sql, parameters).ToList();
            }
        }

        /// <summary>
        /// Test method to verify we can access Ice schema
        /// </summary>
        public bool TestIceSchemaAccess()
        {
            try
            {
                using (var dataAccess = ConnectionFactory.GetErp().GetDataAccess())
                {
                    // Simple test query to verify Ice schema exists and is accessible
                    var parameters = new SqlParameterList();
                    parameters.Add(Site.CompanyCode);

                    string sql = @"SELECT COUNT(*)
                                   FROM [Ice].[XFileRef]
                                   WHERE Company = @p0";

                    var result = dataAccess.Query<int>(sql, parameters).FirstOrDefault();
                    return result >= 0; // Even 0 records means schema exists
                }
            }
            catch (Exception ex)
            {
                // Log error using IErrorLogger if available
                var errorMessage = $"Ice schema test failed for Company '{Site.CompanyCode}': {ex.Message}";

                if (ErrorLogger != null)
                {
                    ErrorLogger.LogError(ex, errorMessage);
                }
                else
                {
                    System.Diagnostics.Debug.WriteLine(errorMessage);
                }

                return false;
            }
        }
    }
}

